str = ""

def reduce(str)
  prev = ''
  new_str = ''
  str << ' '
  str.each_char do |char|
    if prev.upcase == char.upcase && prev != char
      prev = ''
    else
      new_str << prev
      prev = char
    end
  end
  new_str
end

length = str.length
loop do
  puts str
  new_str = reduce(str)
  new_length = new_str.length
  break if new_length == length

  length = new_length
  str = new_str
end

puts length
